import React from "react";
import ReactDOM from "react-dom/client";

/// these are needed for React
/// One is React essentials
/// other is the React DOM

function App() {
  return (
    <div>
      <h1>Hello React!!!!!</h1>
      <Pizza />
    </div>
  );
}

function Pizza() {
  return <h2>Pizza</h2>;
}

/// we made the pizza component
/// this element is simply a H2 with pizza inside of it

/// we then added this inside the App function
/// we could use 2 elements inside here as we wrapped them in a div

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
